import React from "react";
import styled from "styled-components";
import NavbarComp from "../UI/NavbarComp";

const AboutBanner = () => {
  return (
    <Container>
      <NavbarComp />
      <BannerBG>
        <ContentDiv>
          <p>Our Team</p>
        </ContentDiv>
      </BannerBG>
    </Container>
  );
};
export default AboutBanner;

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #151515;
  color: white;
`;

const BannerBG = styled.div`
  width: 100vw;
  height: 424px;
  overflow: hidden;
  background: url("/static/images/about/aboutbanner.jpg") top center no-repeat;
`;

const ContentDiv = styled.div``;
